import React from "react";
import { Link } from "react-router-dom";

function Nav(props) {
  return (
    <nav>
      LOGO
      <ul className="nav-links">
        <Link to="/">
          <li>Homepage</li>
        </Link>
        <Link to="Shop">
          <li>Shop</li>
        </Link>
        <Link to="Cart">
          <li>Cart</li>
          <p>{props.cartItems.length}</p>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
